import { Card } from 'semantic-ui-react'

function SheetList({ sheets }) {
  function mapLogsToItems(sheets) {
    return sheets.map(sheet => ({
      header: sheet.description,
      meta: `Rows: ${sheet.rows}`,
      color: "teal",
      fluid: "true",
      childkey: sheet._id,
      href: `/sheets?_id=${sheet._id}`
    }));
  }
  return <Card.Group fluid itemsPerRow="1" items ={mapLogsToItems(sheets)} />
};

export default SheetList;
